import React from 'react'
import { Link } from 'react-router-dom'

const ProjectCard = ({ card }) => {
  return (
    <Link to="/" className="block sm:inline-block">
      <div className="w-full sm:w-[300px] bg-gray-300 h-[300px] grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4 rounded-md overflow-hidden cursor-pointer border-solid mt-6">
        <img className="w-full h-[70%] object-cover" src={card.img} alt="" />
        <div className="p-4">
          <div className="flex items-center gap-2">
            <img className="w-8 h-8 rounded-full object-cover" src={card.pp} alt="" />
            <div>
              <h2 className="text-sm font-medium">{card.cat}</h2>
              <span className="text-sm font-light">{card.username}</span>
            </div>
          </div>
        </div>
      </div>
    </Link>
  );
};

export default ProjectCard;

